import React from 'react'
import '../GofundNFT.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function OqueEgoFund(){
    return (
      <div class="container-fluid "  >      
        <div class="row ">
            <div class="col-12" style={{alignItems:'center'}} >
                <div id="OqueEgoFund" style={{textAlign:'center'}}>
                    <h1 className="gradient" style={{fontWeight:'700', fontSize:'30px'}}>O QUE É GOFUND NFT</h1>

                    <p style={{color:'#454545',fontSize:'16px',fontWeight:'300',marginTop:'40px'}}>GoFundNFT fornece uma solução ponta a ponta para emissão de <b>Fan Token Utility</b>.     
                    </p>
                    <p> Através da tecnologia <b>Blockchain</b> você irá emitir sua própria moeda para que seus <br/> fãs tenham acessos a programa de benefícios que você oferecer.
                    </p>
                </div>
            </div>     
            
        </div>
      </div>
        
    );
}

export default OqueEgoFund;
